export default function RecipeList(props) {
    const recipes = props.info;

  return (
    <div className="recipe-list">RecipeList
    {recipes.map((recipe) => (
        <div className="recipe-preview" key={recipe.id}>
            </div>
    ))}
    </div>
  )
}
